Amphenol Corporation (“Amphenol” or the “Company”) is one of the world’s largest
designers, manufacturers and marketers of electrical, electronic and fiber optic
connectors, interconnect systems and coaxial and flat-ribbon cable. The Company
was incorporated in 1987. Certain predecessor businesses, which now constitute
part of the Company, have been in business since 1932. The primary end markets
for the Company’s products are:

†          communication systems for the converging technologies of voice, video
and data communications;

†          a broad range of industrial applications including factory automation
and motion control systems, medical and industrial instrumentation, mass
transportation and natural resource exploration, and automotive applications;
and

†          commercial aerospace and military applications.&nbsp;&nbsp;... More..."http://secfilings.nasdaq.com/edgar_conv_html%2f2007%2f02%2f21%2f0001104659-07-012769.html#FIS_BUSINESS" &nbsp;&nbsp;

