We are the world’s largest diversified resources group with a combined market
capitalisation of approximately US$82 billion as of 30 June 2005 and we
generated combined turnover (including our share of joint ventures and
associates) and attributable profit (including exceptional items) of US$31.8
billion and US$6.4 billion, respectively, for the year ended 30 June 2005. We
hold industry leader or near-leader positions in a range of products, including
(after our acquisition of WMC Resources Ltd referred to below) being the:



  •   world’s largest exporter of metallurgical coal for the steel industry;




  •   world’s second largest exporter of energy coal;




  •   world’s third largest producer of iron ore;




  •   world’s second largest producer of copper;




  •   world’s third largest producer of nickel metal;




  •   world’s largest producer of high grade manganese ore;




