Article 114 The Company shall have a general manager who shall be
appointed or removed by the Board of Directors.


                                      30



         Article 115 The general manager is responsible to the Board of
Directors and shall exercise the following powers:

         1. to be in charge of the production, operation and management of the
Company and organizing the implementation of the resolutions of the Board of
Directors;

         2. to organize the implementation of the Company's annual business
plan and investment plan;

         3. to formulate the proposal for the internal management structure;

         4. to formulate the basic management system;

         5. to formulate the detailed rules and regulations for the Company;

         6. to propose the appointment and dismissal of the deputy general
manager and financial officer of the Company;

