The Company directly, and through its ownership of associated companies,
publishes 56 daily newspapers in 23 states and more than 300 weekly, classified
and specialty publications, along with associated and integrated online sites.
The Company was founded in 1890, incorporated in 1950, and listed on the New
York Stock Exchange in 1978. Before 2001, the Company also operated a number of
network-affiliated and satellite television stations. In 2006, the Company sold
the assets of its publishing and commercial printing operations in Seattle and
Spokane, Washington and Portland, Oregon.



The Company is consistently focused on six key strategic priorities. They are
to:



  †   Grow revenue creatively and rapidly;


  †   Emphasize strong local news;


  †   Accelerate our online innovation;


  †   Increase circulation, readership and online audiences;


  †   Nurture employee development and achievement; and


  †   Exercise careful cost control.&nbsp;&nbsp;... More..."http://secfilings.nasdaq.com/edgar_conv_html%2f2006%2f12%2f14%2f0001193125-06-253473.html#FIS_BUSINESS" &nbsp;&nbsp;

