Modine is a global leader in thermal management technology, serving the
vehicular, industrial, commercial, building HVAC&R (heating, ventilating, air
conditioning and refrigeration) and electronics markets. Modine develops,
manufactures, and markets thermal management products, components and systems
for use in various original equipment manufacturer (“OEM”) applications and to a
wide array of building and other commercial markets. Our primary customers
across the globe are:

- Truck, automobile, bus, and specialty vehicle OEMs;
- Agricultural and construction OEMs;
- Heating and cooling OEMs;
- Construction contractors;
- Wholesalers of plumbing and heating equipment;
- Computer and server OEMs;
- Telecommunications OEMs;
- Industrial electronics OEMs; and
- Fuel cell manufacturers.&nbsp;&nbsp;... More..."http://secfilings.nasdaq.com/edgar_conv_html%2f2007%2f05%2f30%2f0000067347-07-000060.html#FIS_BUSINESS" &nbsp;&nbsp;

Northwest Airlines Corporation (“NWA Corp.” and, together with its subsidiaries,
the “Company”) is the indirect parent corporation of Northwest Airlines, Inc.
(“Northwest”).  Unless otherwise indicated, the terms “we,” “us,” and “our”
refer to NWA Corp. and all consolidated subsidiaries.  Northwest operates the
world’s sixth largest airline, as measured by 2006 revenue passenger miles
(“RPMs”), and is engaged in the business of transporting passengers and cargo. 
Northwest began operations in 1926.  Northwest’s business focuses on the
operation of a global airline network through its strategic assets that include:

†          domestic hubs at Detroit, Minneapolis/St. Paul and Memphis;

†          an extensive Pacific route system with a hub in Tokyo;

†          a transatlantic joint venture with KLM Royal Dutch Airlines (“KLM”),
which operates through a hub in Amsterdam;

†          a domestic and international alliance with Continental Airlines, Inc.&nbsp;&nbsp;... More..."http://secfilings.nasdaq.com/edgar_conv_html%2f2007%2f03%2f16%2f0001104659-07-020022.html#FIS_BUSINESS" &nbsp;&nbsp;
